sourcesContent:
const { createCanvas, loadImage } = require('canvas');
const fs = require('fs');


const test=() => {
    // Kích thước của canvas
    const canvasWidth = 800;
    const canvasHeight = 600;
    
    // Khởi tạo canvas
    const canvas = createCanvas(canvasWidth, canvasHeight);
    const ctx = canvas.getContext('2d');
    
    // Load ảnh
    loadImage("C:/Users/napoleQuang/Downloads/ocr2/server/public/images/page0.png").then((image) => {
        // Vẽ ảnh lên canvas '../public/images/page0.png'
        ctx.drawImage(image, 0, 0, canvasWidth, canvasHeight);
    });
    
    let startX, startY, width, height;
    let isDragging = false;
    
    // Sự kiện mousedown chuột
    canvas.onmousedown = (event) => {
        startX = event.offsetX;
        startY = event.offsetY;
        isDragging = true;
    };
    
    // Sự kiện mousemove
    canvas.onmousemove = (event) => {
        if (!isDragging) return;
        width = event.offsetX - startX;
        height = event.offsetY - startY;
    
        // Xóa canvas và vẽ lại ảnh
        ctx.clearRect(0, 0, canvasWidth, canvasHeight);
        ctx.drawImage(image, 0, 0, canvasWidth, canvasHeight);
    
        // Vẽ hình chữ nhật tương ứng với vùng đã chọn
        ctx.strokeStyle = 'red';
        ctx.lineWidth = 2;
        ctx.strokeRect(startX, startY, width, height);
    };
    
    // Sự kiện mouseup
    canvas.onmouseup = () => {
        isDragging = false;
        console.log(`Vùng chọn: (${startX}, ${startY}), width: ${width}, height: ${height}`);
    };
    
    // Lưu canvas ra file ảnh (optional)
    const out = fs.createWriteStream('output.png');
    const stream = canvas.createPNGStream();
    stream.pipe(out);
    out.on('finish', () => {
        console.log('The PNG file was created.');
    });
    
    // Đường dẫn đến file HTML mà bạn muốn hiển thị canvas
    console.log(`Open file://${__dirname}/index.html in your browser`);
    
}

module.exports = test;

